`310-313`: **Consider honoring OTEL_SERVICE_NAME in service.name resolution order.**

The new default value and helper look good. For completeness and spec alignment, consider reading `process.env.OTEL_SERVICE_NAME` when deriving `service.name`. Suggested order:
- `options.appName` (explicit override)
- `process.env.OTEL_SERVICE_NAME` (OTel standard env)
- `process.env.npm_package_name`
- `"unknown_service"` (spec default)



Apply this diff:

